import React, { Component } from 'react'

export default class Button extends Component {
  state = {
    clicked:false
  };
  render() {
    return (
      <div className="text-center text-secondary">
        <h1 style={{marginBottom:'5%'}}>Welcome to the NBA Fantasy Ranking Calculator</h1>
        <div>
          <button className="btn btn-primary btn-sm">Official Fantasy Rules</button>
          <span style={{margin:25}}></span>
          <button className="btn btn-primary btn-sm">Custom Fantasy Rules</button>
        </div>
        <div>
          <table className="table table-bordered">Here are the Rankings:</table>
        </div>
      </div>
    )
  }
}
